import React, {Component} from 'react'
import ModalWrapper from '../Modals/ModalWrapper';

export default class SignEditor extends Component {
    render() {
        return (
            <ModalWrapper
                {...this.props}
                title="Edit Support"
                width
                ={400}
                showOk={this.props.showOk}>

                <div>
                    <p>I am the Sign Editor</p>
                </div>
            </ModalWrapper>
        )
    }
}
